Actionscript.script:
攻击时移动 = _root.敌人二级函数.攻击时移动;
Z轴追踪移动 = _root.敌人二级函数.Z轴追踪移动;

gotoAndPlay(_parent.近战招式);

距离X = Math.abs(_parent._x - _root.gameworld[_parent.攻击目标]._x);
//距离Z = Math.abs(_parent.Z轴坐标 - _root.gameworld[_parent.攻击目标].Z轴坐标);
_parent.近战招式 = 距离X < 150 ? "斩击" : "射击";
gotoAndPlay(_parent.近战招式);

function 斩击()
{
	子弹属性 = _root.子弹属性初始化(this.攻击点);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 = _parent.空手攻击力;
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 2;
	子弹属性.不硬直 = true;

	子弹属性.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹属性);
}

function 射击(射击点, 角度偏移){
	子弹属性 = _root.子弹属性初始化(射击点);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "shoot.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 8;
	子弹属性.子弹种类 = "穿刺子弹";
	子弹属性.子弹威力 = _parent.空手攻击力;
	子弹属性.子弹速度 = 25;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;
	子弹属性.角度偏移 = isNaN(角度偏移) ? 0 : 角度偏移;

	子弹属性.区域定位area = undefined;

	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(enterFrame){
	_parent.攻击时移动(-12);
	_parent.Z轴追踪移动(8);
}

onClipEvent(enterFrame){
	_parent.攻击时移动(12);
	_parent.Z轴追踪移动(8);
}
